import './App.css';

import Home from './Pages/Home/Home';
import Header from './Pages/Header/Header';
import Footer from './Pages/Footer/Footer';
import InforFilm from './Pages/InforFilm/InforFilm';
import VideoFilm from './Pages/VideoFilm/VideoFilm';
import FindFilm from './Pages/FindFilm/FindFilm';
import Routes from './Routers/Routes';
import {BrowserRouter as Router,Route } from 'react-router-dom';

function Page(){
  return(
    <Routes>
      {
        Routes.map((component,index) => {
          return(
            <Route
                key = {index}
                exact = {component.data}
                element = {component.main()}
            />
          )
        })
      }
    </Routes>
  )
}


function App() {

  return (
    <div className = {`App`}>
      <Header/>
      <Router>
    <div className="App">
        <Route path="/" exact component={Home} />
        <Route path="/about" component={About} />
        <Route path="/contact" component={Contact} />
        <Route component={NotFound}/>
    </div>
</Router>
      <Footer/>
    </div>
  );
}

export default App;
